import * as React from 'react';
import Card from '@mui/material/Card';
import CardHeader from '@mui/material/CardHeader';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Chip from '@mui/material/Chip';
import Stack from '@mui/material/Stack';

import Avatar from '@mui/material/Avatar';

import "./GridContent.css";
import Image from "../imgExample/frog.png";
import Song from "../imgExample/songvatar.png";

import PublicIcon from '@mui/icons-material/Public';

export default function GridContent() {

  const handleClick = () => {
    console.info('You clicked the Chip.');
  };

  return (
    <Card sx={{ maxWidth: 345 }}>
      <CardMedia
        component="img"
        height="140"
        image={Image}
        alt="green iguana"
      />

      <CardContent>
        <Typography gutterBottom variant="h6" component="div">
          [유미의 세포들] 웅며드는 과정
        </Typography>
      </CardContent>
      <CardHeader sx={{mt: -3}}
        avatar={
          <Avatar sx={{ width: 20, height: 20}} aria-label="recipe"  src={Song}/>
        }
        title={<Typography variant="body1" color="text.primary" sx={{ ml: -1}}>
            Zoey
        </Typography>}
      />

      <CardContent sx={{paddingTop: 0}}>
        {/* <Stack direction="row" spacing={1}> */}
        <Chip label="primary" color="secondary" size="small" onClick={handleClick} sx={{margin: '2px'}}/>
        <Chip label="success" color="success" size="small" onClick={handleClick} sx={{margin: '2px'}}/>
      {/* </Stack> */}
      <Stack direction="row" sx={{mt: 2, opacity: '60%'}}><PublicIcon/>Public Post</Stack>
      </CardContent>

      <CardHeader sx={{mt: -3, oppacity: '60%'}}
        avatar={
          <PublicIcon sx={{ width: 20, height: 20}} aria-label="public"/>
        }
        title={<Typography variant="body1" color="text.primary" sx={{ ml: '-10px'}}>
            Public Post
        </Typography>}
      />

        {/* <div class="author">
            <Avatar sx={{ width: 20, height: 20}} aria-label="avatar"  src={Song}/>
            <Typography variant="body1" color="text.primary" sx={{ ml: 1}}>
                Zoey
            </Typography>

        </div> */}



      {/* </CardContent> */}
      {/* <CardActions>
        <Button size="small">Share</Button>
        <Button size="small">Learn More</Button>
      </CardActions> */}
    </Card>
  );
}
